function Kilometers({flipped, onChange, amount}) {
    return (
      <div>
      <label htmlFor="kilometers">Kilometer</label>
      <input 
        value={flipped ? amount: Math.round(amount / .621)}
        id="KM" 
        placeholder="KM"
        type="number"
        onChange={onChange}
        disabled={flipped === false}
      />          
    </div>
    )
  }
  export default Kilometers;
